pragma solidity ^0.4.0;

contract TestInput {

    bytes32[] allBytesSubmited;

    function parseBytes(bytes32[] bajtovi){
        require(bajtovi.length <= 5);
        for(uint i=0; i<bajtovi.length; i++){
            allBytesSubmited.push(bajtovi[i]);
        }
    }

    function procitaj(uint index) public view returns (bytes32) {
        return allBytesSubmited[index];
    }
}
